import React, { Component } from "react";
import { Route, Switch } from "react-router-dom";

import { Container, Grid, Divider, Image } from "semantic-ui-react";

import ErrorPage from "./containers/ErrorPage";
import Navbar from "./containers/Navbar";
import Login from "./containers/Login";
import Signup from "./containers/Signup";
import Home from "./containers/Home";
import Record from "./containers/Record";
import MatchHistory from "./containers/MatchHistory";
import Background from "./images/background/background-cement-concrete.jpg";
class App extends Component {
  render() {
    return (
      <Container fluid style={{ padding: "1em" }}>
        <Image src={Background}>
          <Navbar />
          <Divider hidden />
          <Switch>
            <Route path="/home" component={Home} />
            <Route path="/record" component={Record} />
            <Route path="/history" component={MatchHistory} />
            <Route path="/signup" component={Signup} />
            <Route path="/login" component={Login} />
          </Switch>
        </Image>
      </Container>
    );
  }
}

export default App;
